import React from "react";
import { useState } from "react";
import './Education.css';

function Subject(props){
    const subjectStyle = {
        backgroundColor: props.color,
      };
    return (
        <div class='subject' style={subjectStyle}></div>
    );
}

function Education(){
    return (
        <div>
            <Subject color='rgb(27, 150, 212)'></Subject>
            <Subject color='rgb(241, 241, 24)'></Subject>
            <Subject color='rgb(134, 224, 66)'></Subject>
            <Subject color='rgb(237, 177, 74)'></Subject>
            <Subject color='rgb(234, 42, 42)'></Subject>
            <Subject></Subject>
        </div>
    );
}

export default Education;
